import React from 'react';

import NavBar from './components/navBar';
import FormInput from './components/formInput';

import "./components/form.css"
import "rbx/index.css";

 const App = () => {
   return (
     <>
     <div className="container">
      <NavBar />
     </div>
     <div className="form-input">
      <FormInput />
     </div>
     </>
   );
 };

 export default App;
